# include <bits/stdc++.h>
using namespace std;

int subarraysDivByK(vector<int>& nums, int k) {
    int result = 0;

    if(nums[0] % k == 0) 
        result++;
    
    for(int i = 1 ; i < nums.size() ; i++) {
        nums[i] += nums[i - 1];
        if(nums[i] % k == 0)
            result++;
    }

    // for(int i = 0 ; i < nums.size() ; i++) {
    //     if(nums[i] % k == 0)
    //         result++;
    // }

    for(int i = 1 ; i < nums.size() ; i++) {
        for(int j = i ; j < nums.size() ; j++) {
            if((nums[j] - nums[i - 1]) % k == 0) {
                result++;
                // cout << nums[j] << "," << nums[i - 1] << " ";
            }
        }
    }
    return result;
}


